import React from 'react'
import './hero.css'
import ilustra from '../../assets/images/ilustra_header.svg'

export default function Hero(props) {
    return (
        <div className="hero"> 
            <img src={ilustra} alt="Imagen del hero" />
            <input type="text" onChange={props.handleInput} value={props.input} />
            <button type="button" onClick={props.handleButton}>Buscar</button>
        </div>
    )
}
